enum InternalMsg { Replicate(RequestId, char), ReplicateOk(RequestId),
} The server defers sending a PutOk message until replicas reply, but Stateright actors are nonblocking, so they must manage some additional state: the ID of the request, against which replica replies are matched (to guard against late responses), the ID of the client that made the request (to facilitate replying later), and the set of servers that have acknowledged the replicated value (to facilitate waiting until all have replied). #[derive(Clone, Debug, Hash, PartialEq)]
struct ActorState { value: char, delivered: BTreeSet<(Id, RequestId)>, in_flight_put: Option<PutState>,
} #[derive(Clone, Debug, Hash, PartialEq)]
struct PutState { req_id: RequestId, src: Id, peer_acks: BTreeSet<Id>,
} We are now ready to implement the protocol. fn on_msg(&self, _id: Id, state: &mut Cow<Self::State>, src: Id, msg: Self::Msg, o: &mut Out<Self>) { match msg { RegisterMsg::Put(req_id, value) if state.in_flight_put.is_none() => { if state.delivered.contains(&(src, req_id)) { return } let mut state = state.to_mut(); state.value = value; state.delivered.insert((src, req_id)); state.in_flight_put = Some(PutState { req_id, src, peer_acks: Default::default(), }); for &peer_id in &self.peer_ids { o.send(peer_id, RegisterMsg::Internal( InternalMsg::Replicate(req_id, value))); } // Will not reply w/ `PutOk` until all replicas ack. } RegisterMsg::Get(req_id) => { o.send(src, RegisterMsg::GetOk(req_id, state.value)); } RegisterMsg::Internal(InternalMsg::Replicate(req_id, value)) => { if state.delivered.contains(&(src, req_id)) { return } let mut state = state.to_mut(); state.value = value; state.delivered.insert((src, req_id)); o.send(src, RegisterMsg::Internal(InternalMsg::ReplicateOk(req_id))); } RegisterMsg::Internal(InternalMsg::ReplicateOk(req_id)) => { if state.delivered.contains(&(src, req_id)) { return } let mut state = state.to_mut(); if let Some(put) = &mut state.in_flight_put { if req_id != put.req_id { return } put.peer_acks.insert(src); if put.peer_acks == self.peer_ids { o.send(put.src, RegisterMsg::PutOk(req_id)); state.in_flight_put = None; } } } _ => {} } } Now the big question: does this protocol solve the problem we ran into last chapter? Unfortunately achieving linearizability involves a bit more sophistication, and Stateright identifies a sequence of steps that are not linearizable. The sequence is nontrivial and demonstrates why a model checker is so useful for implementing distributed systems. // Fails if there are 3 clients. let checker = RegisterTestSystem { servers: vec![ ActorContext { peer_ids: vec![Id::from(1)].into_iter().collect() }, ActorContext { peer_ids: vec![Id::from(0)].into_iter().collect() }, ], client_count: 3, .. Default::default() }.i