The code starts by implementing a simple server using the " actor model ." An actor is an event oriented process that is able to communicate with other actors over a network by sending messages. The server responds to Put and Get messages based only on its own local state, providing its clients with a simple form of distributed storage, sometimes known as a shared register . Responses are linked to requests via a request ID chosen by the client. type RequestId = u64; #[derive(Clone)]
struct ActorContext; impl Actor for ActorContext { type Msg = RegisterMsg<RequestId, char, ()>; type State = char; fn on_start(&self, _id: Id, _o: &mut Out<Self>) -> Self::State { '?' // default value for the register } fn on_msg(&self, _id: Id, state: &mut Cow<Self::State>, src: Id, msg: Self::Msg, o: &mut Out<Self>) { match msg { RegisterMsg::Put(req_id, value) => { *state.to_mut() = value; o.send(src, RegisterMsg::PutOk(req_id)); } RegisterMsg::Get(req_id) => { o.send(src, RegisterMsg::GetOk(req_id, **state)); } _ => {} } }
} A test follows. It employs a technique called model checking that is similar to property based testing , wherein the programmer writes a predicate indicating what constitutes correct behavior; for example, " the function's output is a sorted permutation of its input ." But whereas property based testing often enumerates the outputs of a deterministic algorithm based on a random sampling of possible inputs, model checking often systematically enumerates the reachable states of a nondeterministic system with less focus on the variety of initial inputs; for example " if clients write X followed by Y to the the same database key K, then a subsequent read may only return Y until the next write, regardless of how the network reorders or redelivers messages ." The test checks the system for a property called linearizability , which loosely speaking means that the visible behavior of the register abstraction provided by the actors is identical to that of a register within a single-threaded system. Terminology : The term "linearizable" derives from the insight that the operations executed by a system form a directed acyclic graph where edges indicate "happens before." For example, if Computer1 sends messages to invoke operations on Computer2 and Computer3, then the message sends happens before Computer2 or Computer3 handle them, but the handling of the messages by Computer2 and Computer 3 lack a defined order because the messages race . A "linearization" defines a viable linear order such as "Computer 1 sends the messages, Computer 3 handles one, and then Computer2 handles the other." A system is not linearizable when its behavior cannot be mapped to a linearization. For example, if the operation invoked on Computer2 was Append "Hello" and Computer3 was Append "World", but the final value interlaced the inputs to form "WolloHerld", then the system would not be linearizable. Either "HelloWorld" or "WorldHello" on the other hand would be valid linearizations since the messages race. The test leverages RegisterTestSystem , which is built into Stateright and defines a system whereby a specified number of clients (only 1 in this case) write distinct values and independently read values without coordinating with one another. Under the hood RegisterTestSystem also leverages Stateright's built-in LinearizabilityTester . Stateright is able to find a bug that arises even if there is only a single client. The bug manifests whenever the network redeliveries messages, something that can and does happen in practice. #[test] fn is_unfortunately_not_linearizable() { let checker = RegisterTestSystem { servers: vec![ActorContext], client_count: 1, .. Default::default() }.into_model().checker().spawn_dfs().join(); //checker.assert_properties(); // TRY IT: Uncomment this line, and the test will fail. checker.assert_discovery("linearizable", vec![ // Here is a counterexample that Stateright will confirm. Each step indicates an // incoming event observed by an actor For brevity counterexamples show actor inputs // such as `Deliver` but not outputs such as `Send`. // // 1. The server receives a write from the client (which it acknowledges). Deliver { src: Id::from(1), dst: Id::from(0), msg: Put(1, 'A') }, // 2. The client receives the ack (and sends a second write with a new value). Deliver { src: Id::from(0), dst: Id::from(1), msg: PutOk(1) }, // 3. The server receives the second write (which it acknowledges). Deliver { src: Id::from(1), dst: Id::from(0), msg: Put(2, 'Z') }, // 4. The network redelivers the first write, inadvertently overwriting the second. Deliver { src: Id::from(1), dst: Id::from(0), msg: Put(1, 'A') }, // 5. The client receives the ack for the second write (and sends a read request). Deliver { src: Id::from(0), dst: Id::from(1), msg: PutOk(2) }, // 6. The server receives the read request (and replies with the current value). Deliver { src: Id::from(1), dst: Id::from(0), msg: Get(3) }, // 7. The client receives a value that violates linearizability. QED. Deliver { src: Id::from(0), dst: Id::from(1), msg: GetOk(3, 'A') }, ]); } The last bit of code defines the main method, which runs the actor on a UDP socket, encoding messages with the JSON format. fn main() { env_logger::init_from_env(env_logger::Env::default().default_filter_or("info")); let handles = spawn( serde_json::to_vec, |bytes| serde_json::from_slice(bytes), vec![ (SocketAddrV4::new(Ipv4Addr::LOCALHOST, 3000), ActorContext) ]); for h in handles { let _ = h.join(); }
}

